import React from 'react';
import './Home.css'
const Home = () => {
    return(
        <div className="additional-content">
            <p style={{ fontSize: '70px' }}>Increase Interview <br></br>Opportunities</p>
            <h3 style={{ fontSize: '23px' }}>SkillSyncer serves as a complimentary tool for job seekers,<br></br>
             offering a resume keyword scanner and application tracker.<br></br>
              Our intelligent system identifies and highlights missing skills<br></br> 
              and keywords on your resume in comparison to a given job<br></br> 
              description.</h3>
                <img src='./WorkLoom.' alt="" className="small-image"/>
                <button className="primary-button1">Get Started</button>
                <div className="topBlur" />
        </div>
    )
}
export default Home;
